import React, { useState } from 'react';
import axios from 'axios';

function AdminPage() {
    const [carInfo, setCarInfo] = useState({
        vin: '',
        exterior_color: '',
        interior_color: '',
        make: '',
        model: '',
        fuel: '',
        year: '',
        list_price: '',
        current_mileage: '',
    });
    const [image, setImage] = useState(null);

    const handleInputChange = (e) => {
        setCarInfo({ ...carInfo, [e.target.name]: e.target.value });
    };

    const handleImageChange = (e) => {
        setImage(e.target.files[0]);
    };

    const handleSubmit = async (e) => {
        e.preventDefault();
        const formData = new FormData();
        Object.keys(carInfo).forEach((key) => formData.append(key, carInfo[key]));
        if (image) {
            formData.append('image', image);
        }

        try {
            await axios.post(`${process.env.REACT_APP_API_URL}/add-car/`, formData, {
                headers: {
                    'Content-Type': 'multipart/form-data',
                },
            });
            // Reset form after successful submission
            setCarInfo({
                vin: '',
                exterior_color: '',
                interior_color: '',
                make: '',
                model: '',
                fuel: '',
                year: '',
                list_price: '',
                current_mileage: '',
            });
            setImage(null);
            alert('Car added successfully!');
        } catch (error) {
            console.error('Error adding car:', error);
        }
    };

    return (
        <div className="admin-page-container">
            <h2>Add Car</h2>
            <form onSubmit={handleSubmit} className="add-car-form">
                {/* Input fields for car information */}
                <input
                    type="text"
                    name="vin"
                    value={carInfo.vin}
                    onChange={handleInputChange}
                    placeholder="VIN"
                    required
                />
                {/* Add other input fields for each car attribute */}
                <input
                    type="file"
                    name="image"
                    onChange={handleImageChange}
                    accept="image/*"
                />
                <button type="submit">Add Car</button>
            </form>
        </div>
    );
}

export default AdminPage;
